import { NumberKeyboard } from 'vant';

export default {
  name: 'NumberKeyboard',
  components: {
    [NumberKeyboard.name]: NumberKeyboard
  },
  props: {
    show: Boolean,
    theme: {
      type: String,
      default: 'default'
    },
    title: String,
    transition: {
      type: Boolean,
      default: true
    },
    zIndex: {
      type: Number,
      default: 100
    },
    extraKey: {
      type: String,
      default: ''
    },
    closeButtonText: {
      type: String,
      default: '完成'
    },
    deleteButtonText: {
      type: String,
      default: '删除'
    },
    showDeleteKey: {
      type: Boolean,
      default: true
    },
    hideOnClickOutside: {
      type: Boolean,
      default: true
    },
    safeAreaInsetBottom: {
      type: Boolean,
      default: false
    }
  },
  methods: {
    onInput (value) {
      this.$emit('input', value);
    },
    onDelete () {
      this.$emit('delete');
    },
    onClose () {
      this.$emit('close');
    },
    onBlur () {
      this.$emit('blur');
    },
    onShow () {
      this.$emit('show');
    },
    onHide () {
      this.$emit('hide');
    }
  }
};
